let Robo =  window.watsonAssistantChatOptions = {
    integrationID: "820afc1e-a165-4a46-b357-7974389bb326", // The ID of this integration.
    region: "brazil", // The region your integration is hosted in.
    serviceInstanceID: "7ec9f572-73ef-4987-a133-f55f02f4ec8c", // The ID of your service instance.
    onLoad: function(instance) { instance.render(); }
  };
setTimeout(function(){
  const t=document.createElement('script');
  t.src="https://web-chat.global.assistant.watson.appdomain.cloud/loadWatsonAssistantChat.js";
  document.head.appendChild(t);
});

export default  Robo;
